Synopsis: When a swaggering, gold chain-wearing Italian wannabe actor from the Bronx -- a guido -- decides to move to Manhattan to pursue his craft, he mistakes the &quot;GWM&quot; in an ad for a roommate for &quot;Guy With Money,&quot; and takes a room in the Village. So the clash of gay and straight cultures commences in this... When a swaggering, gold chain-wearing Italian wannabe actor from the Bronx -- a guido -- decides to move to Manhattan to pursue his craft, he mistakes the &quot;GWM&quot; in an ad for a roommate for &quot;Guy With Money,&quot; and takes a room in the Village. So the clash of gay and straight cultures commences in this farcical debut from Bronx-bred writer-director Tony Vitale
